import { createSlice } from "@reduxjs/toolkit";
import Products from "../../components/Product/Product";

const initalState = {
    products: {
        items: [],
        status: 'loading',
    } ,
    category: {
        items: [],
        status: 'loading',
    } ,

};

const productsSlice = createSlice({
    name: 'products',
    initalState,
    reducer: {},
})

export const productsReducer = productsSlice.reducer;
